import { createRouter, createWebHistory } from 'vue-router';
import MainLayout from '@/layouts/MainLayout.vue';
import HomePage from '@/views/HomePage.vue';
import HomePrihod from '@/views/HomePrihod.vue';

const routes = [
  {
    path: '/',
    component: MainLayout, // Головний макет
    children: [
      {
        path: '',
        name: 'home',
        component: HomePage, // Головна сторінка
      },
      {
        path: 'prihod',
        name: 'HomePrihod',
        component: HomePrihod, // Сторінка "Приход"
      },
    ],
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
